; PSX 'Bare Metal' GPU 16BPP Render Clipped Texture Polygon MASK 15BPP Demo by krom (Peter Lemon):
.psx
.create "RenderTexturePolygonClipMASK15BPP.bin", 0x80010000

.include "LIB/PSX.INC" ; Include PSX Definitions
.include "LIB/PSX_GPU.INC" ; Include PSX GPU Definitions & Macros

.org 0x80010000 ; Entry Point Of Code

la a0,IO_BASE ; A0 = I/O Port Base Address ($1F80XXXX)

; Setup Screen Mode
WRGP1 GPURESET,0  ; Write GP1 Command Word (Reset GPU)
WRGP1 GPUDISPEN,0 ; Write GP1 Command Word (Enable Display)
WRGP1 GPUDISPM,HRES320+VRES240+BPP15+VNTSC ; Write GP1 Command Word (Set Display Mode: 320x240, 15BPP, NTSC)
WRGP1 GPUDISPH,0xC60260 ; Write GP1 Command Word (Horizontal Display Range 608..3168)
WRGP1 GPUDISPV,0x042018 ; Write GP1 Command Word (Vertical Display Range 24..264)

; Setup Drawing Area
WRGP0 GPUDRAWM,0x000508   ; Write GP0 Command Word (Drawing To Display Area Allowed Bit 10, Texture Page Colors = 15BPP Bit 7..8, Texture Page Y Base = 0 Bit 4, Texture Page X Base = 512 Bit 0..3)
DrawingArea 64,12, 264,178; Set Drawing Area: X1,Y1, X2,Y2
WRGP0 GPUDRAWOFS,0x000000 ; Write GP0 Command Word (Set Drawing Offset X=0, Y=0)

; Copy Textures To VRAM
CopyRectCPU 512,0, 8,8 ; Copy Rectangle (CPU To VRAM): X,Y, Width,Height
li t0,31 ; T0 = Data Copy Word Count
la a1,Texture8x8 ; A1 = Texture RAM Offset
CopyTexture8x8:
  lw t1,0(a1) ; T1 = DATA Word
  addiu a1,4  ; A1 += 4 (Delay Slot)
  sw t1,GP0(a0) ; Write GP0 Packet Word
  bnez t0,CopyTexture8x8 ; IF (T0 != 0) Copy Texture8x8
  subiu t0,1 ; T0-- (Delay Slot)

CopyRectCPU 520,0, 16,16 ; Copy Rectangle (CPU To VRAM): X,Y, Width,Height
li t0,127 ; T0 = Data Copy Word Count
la a1,Texture16x16 ; A1 = Texture RAM Offset
CopyTexture16x16:
  lw t1,0(a1) ; T1 = DATA Word
  addiu a1,4  ; A1 += 4 (Delay Slot)
  sw t1,GP0(a0) ; Write GP0 Packet Word
  bnez t0,CopyTexture16x16 ; IF (T0 != 0) Copy Texture16x16
  subiu t0,1 ; T0-- (Delay Slot)

CopyRectCPU 536,0, 32,32 ; Copy Rectangle (CPU To VRAM): X,Y, Width,Height
li t0,511 ; T0 = Data Copy Word Count
la a1,Texture32x32 ; A1 = Texture RAM Offset
CopyTexture32x32:
  lw t1,0(a1) ; T1 = DATA Word
  addiu a1,4  ; A1 += 4 (Delay Slot)
  sw t1,GP0(a0) ; Write GP0 Packet Word
  bnez t0,CopyTexture32x32 ; IF (T0 != 0) Copy Texture32x32
  subiu t0,1 ; T0-- (Delay Slot)

CopyRectCPU 568,0, 64,64 ; Copy Rectangle (CPU To VRAM): X,Y, Width,Height
li t0,2047 ; T0 = Data Copy Word Count
la a1,Texture64x64 ; A1 = Texture RAM Offset
CopyTexture64x64:
  lw t1,0(a1) ; T1 = DATA Word
  addiu a1,4  ; A1 += 4 (Delay Slot)
  sw t1,GP0(a0) ; Write GP0 Packet Word
  bnez t0,CopyTexture64x64 ; IF (T0 != 0) Copy Texture64x64
  subiu t0,1 ; T0-- (Delay Slot)

; Render Texture Polygons

; Setup Mask
WRGP0 GPUMASKBIT,0x01 ; Write GP0 Command Word (Mask Bit Setting: Set Mask While Drawing)

